import React from 'react'

import { Swiper, SwiperSlide } from 'swiper/react';
import 'swiper/swiper.min.css';

import SwiperCore, { Navigation, Pagination } from 'swiper/core';

import 'swiper/components/pagination/pagination.min.css'
import 'swiper/components/navigation/navigation.min.css'
import 'swiper/components/scrollbar/scrollbar.min.css'

import './preview.css';

// import Preview from './Preview';

import img1 from '../../images/landing-shop1.webp';
import img2 from '../../images/landing-shop2.webp';
import img3 from '../../images/landing-shop3.jpg';
import img4 from '../../images/landing-shop4.jpg';
import img5 from '../../images/landing-shop5.jpg';
import img6 from '../../images/landing-shop6.jpg';

SwiperCore.use([Navigation, Pagination]);



const Previews = () => {


  const images = [
    {
      id: 1,
      img: img1,
    },
    {
      id: 2,
      img: img2,
    },
    {
      id: 3,
      img: img3,
    },
    {
      id: 4,
      img: img4,
    },
    {
      id: 5,
      img: img5,
    },
    {
      id: 6,
      img: img6,
    },
  ]

  const result = images.map((image) => {
    return <SwiperSlide key={image.id}>i</SwiperSlide>
  })

  return (
    <div className='content'>
      <h1 className='title-head'>شركائنا في النجاح</h1>
      <Swiper
        spaceBetween={20}
        slidesPerView={4}
        navigation
        // pagination={{ clickable: true }}
        scrollbar={{ draggable: true }}
      >
        <SwiperSlide>i</SwiperSlide>
        <SwiperSlide>i</SwiperSlide>
        <SwiperSlide>i</SwiperSlide>
        <SwiperSlide>i</SwiperSlide>
        <SwiperSlide>i</SwiperSlide>
        <SwiperSlide>i</SwiperSlide>
      </Swiper>
    </div>

  )
}

export default Previews
